import React, { Component } from 'react'
import ProductList from './ProductList';



class UserProduct extends Component {
    state = {
        creating: false
    }

    render() {
        return (
            <div>
                <h1>I am product Page</h1>
                <ProductList />
            </div>
        )
    }
}

export default UserProduct;
